;; **
;;; # Darwin - flexible genetic algorithms
;;; 
;;; Darwin is a flexible framework for programming genetic algorithms, aimed at research applications. It is representation agnostic, working just as well for simple GA examples as it does for complex genetic programming problems. It can be configured to perform both single- and multi-objective optimisation, including the SPEA2 algorithm. It has facility for adaptive evolution where the run parameters evolve in repsonse to changes in the population.
;;; 
;;; This worksheet demonstrates a very simple example. For fuller examples take a look at the algebolic project at https://github.com/JonyEpsilon/algebolic which applies this library to evolve mathematical expressions.
;; **

;; @@
(ns darwin.examples
  (:require [gorilla-plot.core :as plot]
            [darwin.core :as darwin]
            [darwin.evolution.metrics :as metrics]))
;; @@
;; =>
;;; {"type":"html","content":"<span class='clj-nil'>nil</span>","value":"nil"}
;; <=

;; **
;;; We'll try and evolve the characters in the string "Hello, world!". We need four things to run the evolution:
;;; 
;;; - a score function which measures how well a candidate individual is doing at meeting the goal;
;;; - a function to create a random individual;
;;; - a function to mutate an individual;
;;; - a function to breed two individuals to make two more.
;;; 
;;; Let's implement these for the "Hello, world!" problem. We'll represent our individuals as fixed length character vectors. We'll score by comparing the character codes of the letters in the individual with the correct codes and summing the squared differences.
;; **

;; @@
(defn hw-score
  [i]
  (let [i-vals (mapv int i)
        target (mapv int (vec "Hello, world!"))
        diffs (mapv - i-vals target)]
    (reduce + (mapv * diffs diffs))))
