;; **
;;; Crossover should take two individuals and combine them to generate two new individuals. A simple method for vectors is to cut them both at a given index and swap the pieces after the cut.
;; **

;; @@
(defn hw-crossover
  [i1 i2]
  (let [xover-i (rand-int 13)]
    [(vec (concat (take xover-i i1) (nthrest i2 xover-i)))
     (vec (concat (take xover-i i2) (nthrest i1 xover-i)))]))
